import React from "react";

function Home() {
  return (
    <div className="home">
  <h1>Upload your CSV file</h1>
  <form method="POST" action encType="multipart/form-data">
    <p><input type="file" name="file" /></p>
    <p><input type="submit" name="submit_file" defaultValue="Upload" /></p>
  </form>
</div>
 );
}

export default Home;
